import { Route, Switch } from 'react-router-dom';
import About from './components/About';
import Home from './components/sections/Home';

function App() {
  return (
    <Switch>
      <Route exact path="/" component={Home} />
      <Route exact path="/about" component={About} />
    </Switch>
  );
}

export default App;
